import React from 'react';
import Todos from '../Todos';
import AddTodo from '../AddTodo';

function Home() {
    return (
        <React.Fragment>
            <AddTodo addTodo={this.addTodo} />
            <Todos todos={this.state.todos}
                markComplete={this.markComplete}
                delTodo={this.delTodo} />
        </React.Fragment>
    )
}

export default About;
